(function (d3) {
  'use strict';

  const svg = d3.select('svg');

  const height = +svg.attr('height');
  const width = parseFloat(svg.attr('width'));

  const render = data => {
    
    const margin = {top:60, bottom:70, left:130, right:100};
    const innerWidth = width - margin.left - margin.right;
    const innerHeight = height - margin.top - margin.bottom;
          
    const xScale = d3.scaleLinear()
    	.domain([0,d3.max(data, d => d.population)])
    	.range([0, innerWidth]);
    
    
     const yScale = d3.scaleBand()
    	.domain(data.map( d => d.country))
    	.range([0, innerHeight])
  		.padding(0.2);
    
    const g = svg.append('g')
    	.attr('transform', `translate(${margin.left}, ${margin.top})`);
          
    console.log(xScale.domain());
    console.log(xScale.range());
    console.log(yScale.domain());
    console.log(yScale.range());

    g.append('g').call(d3.axisLeft(yScale))
      .selectAll('.domain, .tick line')
      .remove()
    
    g.append('g').call(d3.axisBottom(xScale))
      .attr('transform', `translate(${0}, ${innerHeight})`)
      .append('text').attr('y', 40).attr('x', innerWidth/2).attr('fill', 'black').text('Population')
      .select('.domain')
      .remove()
      
      
      
    g.append('text')
      .attr('y', -10)
      .text('Top 10 Most Populous Countires')


    g.selectAll('circle').data(data)  //joining data to rectungles
    	.enter().append('circle')
    	.attr('cy', d => yScale(d.country) +  yScale.bandwidth() / 2)
    	.attr('cx', d => xScale(d.population))
    	.attr('r', yScale.bandwidth() / 2);
  };

  d3.csv('data.csv').then(data => {
    data.forEach(d => {
      d.population = +d.population*1000;
    });
    render(data);
  });

}(d3));

